import React, { useCallback } from 'react';
import ReactDOM, { render } from 'react-dom';
import './index.css';

import mainLogo from './Tetris_T.png';

class Item extends React.Component{
  constructor(props){
    super(props);
    const FREE = 0;
    const DRAG = 1;

    this.state = FREE;
  }

  _onMouseMove(e){
    alert({x:e.nativeEvent.offsetX, y:e.nativeEvent.offsetY}.x);
  }

  render(){

    return(
      <div>
        <img src={mainLogo}  
          alt="Tetris T Piece" 
          
          width="140" height="100"
          style={{
            position: "absolute",
            left: 140 + "px",
          }}
          
          onClick={
            () => {
              this.state=!this.state
              alert(this.state)
            }
          }

          onMouseMove={
            (e) => this._onMouseMove(e)
          }
        />

      </div>
    )
  }
}

class App extends React.Component{
    render() {
      return(
        <div>
          <Canvas />
          <Item />
        </div>
      )
    }
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
